import React from "react";
import { withRouter } from "react-router-dom";
import { Navbar, Container } from 'react-bootstrap';

function Navigation(props) {
    return (
        <Navbar bg="white">
            <Container>
                <Navbar.Brand herf="#home">
                    <img
                    src="/logo.png"
                    width="30"
                    height="30"
                    className="align-top"
                    alt="T1D logo"
                    />
                </Navbar.Brand>
            </Container>
        </Navbar>
    )
}
export default withRouter(Navigation);
